import json

class Tools:

    def findKey(self, target, json_data):
        queue = [json_data]
        result = []
        while len(queue) > 0:
            data = queue.pop()
            for key, value in data.items():
                if key == target:
                    result.append(value)
                elif type(value) == dict:
                    queue.append(value)
                elif type(value) == list:
                    for temp in value:
                        if type(temp) == dict:
                            queue.append(temp)
                else:
                    try:
                        value_data = json.loads(value)
                        if type(value_data) == dict:
                            queue.append(value_data)
                    except:
                        continue
        print(target)
        print(json_data)
        print(result)
        return result
